import React from 'react';

function initialHeader(props){
   const username = window.localStorage.getItem('username');
   return <div><nav>
      <ul>
         <li><h1>KeeperApp</h1></li>
         <li><h2>Welcome {username}</h2></li>
      </ul>
   </nav>
   </div>
   
}

export default initialHeader;
